import React from 'react';
import './TodoForm.css';

const todoAdder = (props) => {
    return(
        <form onSubmit={props.submitProp}>
            <input className="itemInput" value={props.value} onChange={props.onChange}/>
            <input className="itemAdd" type='submit' value='Add' />
        </form>
    );
}

export default todoAdder;
